import './App.css';
import { BrowserRouter, Route, Routes,Link } from 'react-router-dom';
import { DrinkList } from './component/DrinkList';

import { ViewDrink } from './component/ViewDrink';
import { EditDrink } from './component/EditDrink';
import { AddDrink } from './component/Adddrink';




function App() {
  return (
    <div className="container">
      <BrowserRouter>
      <nav className="btn btn-warning navbar navbar-expand-lg navheader">
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link" to="/adddrink" >AddDrink</Link>
            </li>
            <li className="nav-item">
              <Link  className="nav-link" to="/drinklist">DrinkList</Link>
            </li>
          </ul>
        </div>
      </nav>

      <Routes>
        <Route exact path="/drinklist" element={<DrinkList/>}></Route>
        <Route exact path="/adddrink" element={<AddDrink/>}></Route>
        <Route exact path="/viewdrink/:id" element={<ViewDrink />}></Route>
        <Route exact path="/editdrink/:id" element={<EditDrink />}></Route>
      </Routes>

      </BrowserRouter>
     </div>
  );
}

export default App;
